import { Tabs, Tab } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import PersonOutlinedIcon from "@mui/icons-material/PersonOutlined";
import CalendarTodayOutlinedIcon from "@mui/icons-material/CalendarTodayOutlined";
import HelpOutlineOutlinedIcon from "@mui/icons-material/HelpOutline";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

const Topbar = () => {
  return (
    <Router>
      <Tabs
        defaultActiveKey="/home"
        id="uncontrolled-tab-example"
        className="mb-3"
      >
        <Tab
          eventKey="/home"
          title={
            <Link to="/home">
              <HelpOutlineOutlinedIcon style={{ verticalAlign: "middle" }} />
              Main Page
            </Link>
          }
          className="home"
        >
          <Route path="/home">
            <h1>Home</h1>
          </Route>
        </Tab>
        <Tab
          eventKey="/profile"
          title={
            <Link to="/profile">
              <PersonOutlinedIcon style={{ verticalAlign: "middle" }} />
              Profile Page
            </Link>
          }
        >
          <Route path="/profile">{/* Your profile content here */}</Route>
        </Tab>
        <Tab
          eventKey="/contact"
          title={
            <Link to="/contact">
              <CalendarTodayOutlinedIcon style={{ verticalAlign: "middle" }} />
              Status Tracker
            </Link>
          }
        >
          <Route path="/contact">
            {/* Your contact/status tracker content here */}
          </Route>
        </Tab>
      </Tabs>
    </Router>
  );
};

export default Topbar;
